import React, { useEffect, useState, useContext } from 'react';
import TaskCard from './TaskCard';
import Modal from 'react-modal';
import { TaskListContext } from './';
import { DeleteContext } from '../../Contexts/deleteContext';
import Sidebar from './Sidebar';

const ToDoList = () => {
    const [users, setUsers] = useState([]);
    const [selectedUser, setSelectedUser] = useState('');
    const [modalIsOpen, setModalIsOpen] = useState(false);
    const [newTask, setNewTask] = useState({
        description: '',
        category: '',
        deadline: '',
        priority: 'Medium',
        color: '#ffffff',
        done: false
    });
    const { tasks, fetchTasks, addTask } = useContext(TaskListContext);

    useEffect(() => {
        fetch('http://localhost:8083/api/users')
            .then(response => response.json())
            .then(data => setUsers(data))
            .catch(error => console.error('Error fetching users:', error));
    }, []);

    const openModal = () => setModalIsOpen(true);
    const closeModal = () => setModalIsOpen(false);

    const handleUserChange = (e) => {
        const userId = e.target.value;
        setSelectedUser(userId);
        fetchTasks(userId);
    };

    const handleNewTaskChange = (e) => {
        const { name, value } = e.target;
        setNewTask(prevState => ({ ...prevState, [name]: value }));
    };

    const handleAddTask = () => {
        if (!newTask.description || !newTask.category || !newTask.deadline || !selectedUser) return;
        addTask({ ...newTask, userid: selectedUser });
        closeModal();
    };

    return (
        <div className="todo-app">
            <Sidebar selectedUser={selectedUser} />
            <div className="content">
                <h1>TODO List</h1>
                <select value={selectedUser} onChange={handleUserChange}>
                    <option value="">Select User</option>
                    {users.map((user) => (
                        <option key={user.id} value={user.id}>{user.name}</option>
                    ))}
                </select>
                <button onClick={openModal}>Add Task</button>
                <div id="todo-cards">
                    {tasks.map((task) => (
                        <TaskCard
                            key={task.id}
                            id={task.id}
                            name={task.description}
                            list={task.category}
                            color="#ffffff"
                            done={task.completed}
                        />
                    ))}
                </div>
                <Modal isOpen={modalIsOpen} onRequestClose={closeModal}>
                    <h2>Add Task</h2>
                    <form>
                        <label>
                            Description:
                            <input
                                type="text"
                                name="description"
                                value={newTask.description}
                                onChange={handleNewTaskChange}
                            />
                        </label>
                        <label>
                            Category:
                            <input
                                type="text"
                                name="category"
                                value={newTask.category}
                                onChange={handleNewTaskChange}
                            />
                        </label>
                        <label>
                            Deadline:
                            <input
                                type="date"
                                name="deadline"
                                value={newTask.deadline}
                                onChange={handleNewTaskChange}
                            />
                        </label>
                        <label>
                            Priority:
                            <select
                                name="priority"
                                value={newTask.priority}
                                onChange={handleNewTaskChange}
                            >
                                <option value="Low">Low</option>
                                <option value="Medium">Medium</option>
                                <option value="High">High</option>
                            </select>
                        </label>
                    </form>
                    <button onClick={handleAddTask}>Add Task</button>
                    <button onClick={closeModal}>Cancel</button>
                </Modal>
            </div>
        </div>
    );
};

export default ToDoList;
